css:
body {
  /* Set the background image */
  background-image: url("https://wallpaperwaifu.com/wp-content/uploads/2020/12/retro-80s-with-blue-neon-moon-thumb.jpg") !important;

  /* Set the background image to cover the entire screen */
  background-size: cover !important;

  /* Set the background image to be fixed in place */
  background-attachment: fixed !important;

  /* Center the background image vertically and horizontally */
  background-position: center center !important;
}
